import React from 'react';
import s from "./Header.module.css";
import settings from '../../img/settings.svg';
import info from '../../img/info.svg';
import exit from '../../img/exit.svg';
import userPhoto from '../../img/photo.jpg';
import {NavLink} from "react-router-dom";

const Header = () => {
  return (
    <div className={s.headerWrapper}>
      <div className={s.container}>
        <div className={s.header}>
          <nav className={s.headerNav}>
            <NavLink exact to={'/'} className={s.headerLink}>Home</NavLink>
            <a href="#" className={s.headerLink}>Issues</a>
            <a href="#" className={s.headerLink}>Filter</a>
            <a href="#" className={s.headerLink}>Projects</a>
            <div className={s.line}></div>
          </nav>
          <div className={s.headerItem}>
            <a href="#" className={s.iconLink}>
              <img src={settings} alt='settings'/>
            </a>
            <a href="#" className={s.iconLink}>
              <img src={info} alt='info'/>
            </a>
            <a href="#" className={s.iconLink}>
              <img src={exit} alt='exit'/>
            </a>
            <a href="#" className={s.iconLink}>
              <img src={userPhoto} alt='userPhoto' className={s.headerUser}/>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Header;
